create table if not exists USERS (
	id INT,
	Title VARCHAR(50),
	Firstnames VARCHAR(50),
	Surname VARCHAR(50),
	Email VARCHAR(50),
	Mobile VARCHAR(50),
	HomeAddress1 VARCHAR(50),
	HomeAddress2 VARCHAR(50),
	HomeTown VARCHAR(50),
	HomeCounty VARCHAR(50),
	HomeZipCode VARCHAR(50),
	BillingAddress1 VARCHAR(50),
	BillingAddress2 VARCHAR(50),
	BillingTown VARCHAR(50),
	BillingCounty VARCHAR(50),
	BillingZipCode VARCHAR(50)
);
